import { createRouter, createWebHistory } from 'vue-router';
import RegisterForm from '../components/RegisterForm.vue';
import CreatePasswordForm from '../components/CreatePasswordForm.vue';

const routes = [
  { path: '/', name: 'Register', component: RegisterForm }, // Registro
  { path: '/create-password', name: 'CreatePassword', component: CreatePasswordForm }, // Creaci칩n de contrase침a
  { path: '/:pathMatch(.*)*', redirect: '/' }, // Redirige rutas no encontradas al registro
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
